import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [searchText, setSearchText] = useState('');
  const [searchCategory, setSearchCategory] = useState('Category1');

  const handleSearchChange = (event) => {
    setSearchText(event.target.value);
  };

  const handleCategoryChange = (event) => {
    setSearchCategory(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Search Text:', searchText);
    console.log('Search Category:', searchCategory);
    // Perform search or other actions with searchText and searchCategory values
  };

  return (
    <nav className="navbar">
     
      <form className="search-form" onSubmit={handleSubmit}>
        <select value={searchCategory} onChange={handleCategoryChange} className="search-select">
          <option value="Category1">Category 1</option>
          <option value="Category2">Category 2</option>
          <option value="Category3">Category 3</option>
        </select>
        <input type="text" value={searchText} onChange={handleSearchChange} className="search-input" placeholder="Character Name" />
        <button type="submit" className="search-btn">Search</button>
      </form>

      <div className="nav-logo">My App</div>
      <ul className="nav-links">
        <li className="nav-item"><a href="/about">About</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
